    private void sendMessage(BytesXMLMessage message, String topic) throws JCSMPException {
        //System.out.println("sending to "+destination+" -- "+message.dump());
        Topic destination = JCSMPFactory.onlyInstance().createTopic(topic);
        if (connected) {
            producer.send(message,destination);
        }
    }
    
    /////////////////////////////////// USER INTERACTION PARTS

    // This could be a user car, or a random car... just picks one of the routes
    void addCar(String name, String id, boolean autoGenerated) {
        int routeNum = (int)Math.floor(Math.random()*rawRoutes.size());
        Vehicle newVehicle = new Vehicle(name,id,routeNum,autoGenerated);
        service.scheduleAtFixedRate(newVehicle,(long)(Math.random()*GPS_UPDATE_RATE_MS),GPS_UPDATE_RATE_MS,TimeUnit.MILLISECONDS);
        System.out.printf("New Car: %s, choosing route #%d%n",id,routeNum);
    }
    
    void addRandomCars(int number) {
        for (int i=0;i<number;i++) {
            String carName = String.format("CAR%04d",i);
            addCar(carName,carName,true);
        }
    }
    
    void addFaultToCar(String id, String fault) {
    	Vehicle v = vehicles.get(id);
    	Status s = null;
    	switch (fault) {
    	case "FRONT_TIRE":
    		s = Status.FRONT_TIRE;
    		break;
    	case "REAR_TIRE":
    		s = Status.REAR_TIRE;
    		break;
    	case "LIGHT":
    		s = Status.LIGHT;
    		break;
    	case "ENGINE":
    		s = Status.ENGINE;
    		break;
    	}
    	v.triggerFault(s);
    }
    
    void clearFaultFromCar(String id) {
    	Vehicle v = vehicles.get(id);
    	v.clearFault();
    }
    
    void removeCar(String id) {
    	Vehicle v = vehicles.remove(id);
     	v.remove();
   }
    
    ///////////////////////////////////
    
    List<Point2D.Double> getRawRoute(String data) { //copyright, String startAddr, String endAddr, String dist, String time, List<Point2D.Double> coords)
        String[] fields = data.split("\\|");
        String[] coords = fields[5].split(";");
        List<Point2D.Double> route = new ArrayList<Point2D.Double>();
        for (String coord : coords) {
            String[] latlon = coord.split(",");
            double lat = Double.parseDouble(latlon[0]);
            double lon = Double.parseDouble(latlon[1]);
            route.add(new Point2D.Double(lat,lon));  // x=lat, y=lon
        }
        return route;
    }

    void load() {
        for (int i=0; i < coords.length; i++) {
            rawRoutes.add(getRawRoute(coords[i]));
        }
    }

